import React from 'react';

const Education = () => (
  <section id="education">
    <h2>Education</h2>
    <h3>ALX Africa</h3>
    <p>Software Engineering</p>
    <p>Completed an intensive program in software engineering, gaining hands-on experience in programming languages, development frameworks, data structures, and algorithms.</p>
    <p>May 2023 - July 2024</p>
    <h3>High School Certificate</h3>
  </section>
);

export default Education;
